import React from 'react';
import {arrowLeft,a} from "./images/icon-prev.svg"



function Slider(){
    return <div>
    <button class="slider__btn slider__previous"><img src={icon} alt="previous-slide"/></button>
    <button class="slider__btn slider__next"><img src={require("./images/icon-next.svg")}  alt="next-slide" /></button>
    
    </div>
}

export default Slider
